            "name": "Aurora Borealis in Finnish Lapland",
            "description": "This is selection of northern lights we filmed during the winter 2011 in several locations in the Finnish Lapland. It's filmed with DSLR cameras with timelapse technique and with remote pan/tilt heads. \n\nVideo is available also in 2K and 4K resolution.\n\nClient: Visit Finland (http://www.visitfinland.com)\nProduction and concept: Flatlight Films ( http://www.flatlightfilms.com)\nMusic: CC33 ( http://soundcloud.com/cc33 )\n\nIf you have any questions about the video and techniques we used don't hesitate to contact us!\n\nConnect with us:\n\nhttp://www.flatlightfilms.com\nhttp://www.facebook.com/flatlightfilms\nhttp://www.youtube.com/flatlightfilms\nhttp://www.twitter.com/flatlightfilms",
