            "uri": "/videos/6932347",
            "name": "TURBO",
            "description": "TURBO is a high adrenaline short film in the tradition of The Karate Kid and Tron.  It tells the story of Hugo Park (Justin Chon, 21 &amp; Over, Twilight) a troubled youth whose only outlet for angst is a 4D fighting videogame called “Super Turbo Arena”.  When Pharaoh King (Jocko Sims, Crash the Series), the Michael Jordan of cyber-sports, announces a tournament to determine who will join his pro-team, Hugo sets his eyes on the prize.  But, Hugo isn't the only gamer who wants fame and glory.  If Hugo wants to win he's going to have to beat Shamus (David Lehre, Epic Movie), the all time Turbo champ at the local Pandemonium arcade, and Ruse Kapri, a feisty prep girl that knows how to win.  Realizing he can't win on his skill alone, Hugo turns to his brother Tobias a former kick-boxer whose last match left him wheel-chair ridden.  Together the two will mend old wounds and see if a washed up street fighter can teach a troubled teen how to become a virtual gladiator!\n\nhttp://www.turbothemovie.com \n\na Jarrett Lee Conaway film\nhttp://www.bfamstudios.com",
