            "name": "Salar de Uyuni, Bolivia",
            "description": "EDIT: I am currently programming a video shooting in the Salar for an upcoming documentary. I am looking for a Salar local fixer at the moment, anyone interested should contact me! ayrton.orio@gmail.com or directly through vimeo.\nThe project also involves talented DP Sylvain Nawrocki (https://vimeo.com/sylvainnawrocki) and expert drone pilot Nicolas Deburge (https://vimeo.com/user21224686)\n\nCanon eos 7d\n17-55mm f/2,8\n70-200mm f/2,8\n50mm f/1,8\n4,5mm f/2,8\n\nShot in Uyuni, Bolivia.\nPost processing in After Effect\nEdited with Premiere Pro\n\nMusic Cliff Martinez - I that everybody wants (from the motion picture Solaris)\n\nCredits: Sharon Kendelker // Marlène Habérard",
